import React,{Component} from 'react';
import {BrowserRouter, Route , Switch} from 'react-router-dom'
import './Main.css'
import Home from './components/home'
import Aboutus from './components/aboutus'
import ContactUs from './components/contact'
import Navbar from './components/navbar'
import Result from './components/result'
import SelectT from './components/selectt'
import Survey from './components/survey'
import * as firebase from "firebase"
const firebaseConfig = {
     apiKey: "AIzaSyDAfrBCDG9V_JRg0WIY_VXYNlPiGkW4lw8",
     authDomain: "cv-constructor-8ed30.firebaseapp.com",
     databaseURL: "https://cv-constructor-8ed30.firebaseio.com",
     projectId: "cv-constructor-8ed30",
     storageBucket: "cv-constructor-8ed30.appspot.com",
     messagingSenderId: "907257437212",
     appId: "1:907257437212:web:bd3a0d3fcab00f1d3bd3d9",
     measurementId: "G-4HGN3DCWGR"
   };
   firebase.initializeApp(firebaseConfig);
export default class MainPage extends Component{
  render(){
   return(
   <BrowserRouter>
   <div>
   <Navbar/>
   <Switch>

   <Route path='/' component={Home} exact />
   <Route path='/Aboutus' component={Aboutus}/>
   <Route path='/ContactUs' component={ContactUs}/>}/>
   <Route path='/result' component={Result}/>
   <Route path='/selecttemplate' component={SelectT}/>}/>
   <Route path='/survey' component={Survey}/>}/>

   </Switch>
   </div>
   </BrowserRouter>
   );

}}
